import React, { Component } from 'react';
//import React from "react";
import "./App.css";
import "./App.scss";
//import {BrowserRouter as Router,Route} from 'react-router-dom';
import { Layout, Header, Navigation, Drawer, Content } from 'react-mdl';
import Main from './components/assure/main';
//import user from './user';
import { Link } from 'react-router-dom';




class debut extends Component {

  render() {

    return (
      <div className="demo-big-content">
    <Layout>
        <Header className="header-color" title={<Link style={{textDecoration: 'none', color: 'white'}} to="/app/assure1">Mon Espace Assurance</Link>} scroll>
            <Navigation>
                <Link to="/app/assure/resume">Profile</Link>
                <Link to="/app/assure/aboutme">aboutme</Link>
                <Link to="/app/assure/projects">Biens Assurés</Link>
                <Link to="/app/assure/contact">Contact</Link>
            </Navigation>
        </Header>
        <Drawer title={<Link style={{textDecoration: 'none', color: 'black'}} to="/app/assure1">Mon Espace</Link>}>
            <Navigation>

              <Link to="/app/assure/resume">Profile</Link>
              <Link to="/app/assure/aboutme">aboutme</Link>
              <Link to="/app/assure/contact">djodjo</Link>
              <Link to="/app/assure/projects">Biens Assurés</Link>
              <Link to="/app/assure/contact">Contact</Link>
            </Navigation>
        </Drawer>
        <Content>
            <div className="page-content" />
         //  <Main/>
        </Content>
    </Layout>
</div>

    );
  }
}



export default debut;
